        # return answer
        
        # Brute force solution with O(n^2) time complexity
        # n = len(nums)
        # answer = [1] * n
        # prefix = [1] * n
        # suffix = [1] * n
        # if n == 2:
        #     answer = nums[::-1]
        # else:
