        #         prefix = math.prod(nums[:i])
        #         suffix = math.prod(nums[i+1:])
        #         prod = prefix * suffix
        #         answer[i] = prod
        # return answer

        n = len(nums)
        answer = [1] * n
        prefix = []
        pre = 1
        suffix = []
        suf = 1
        if n == 2:
            answer = nums[::-1]
        else:
            for i in nums:
                pre *= i
                prefix.append(pre)
            print("Prefix: ", prefix)
            for i in nums[::-1]:
                suf *= i
                suffix.append(suf)
            suffix = suffix[::-1]
            print("Suffix: ", suffix)
            for i in range(n):
                if (i-1) < 0:
                    prod = 1 * suffix[i+1]
                elif (i+1) >= n:
                    prod = 1 * prefix[i-1]
                else:
                    prod = prefix[i-1] * suffix[i+1]
                print(prod)
                answer[i] = prod
        return answer
    
